CREATE SCHEMA `sellphonecard`;

USE sellphonecard;

create table user
(
    id          int          not null AUTO_INCREMENT,
    account     varchar(255) not null,
    password    varchar(255) not null,
    email       varchar(255) not null,
    role        int,
    phoneNumber varchar(255),
    balance     int,
    isDelete    boolean,
    isActive    boolean,
    createdAt   datetime,
    createdBy   int,
    updatedAt   datetime,
    updatedBy   int,
    deletedAt   datetime,
    deletedBy   int,
    primary key (id)
);

create table product
(
    id        int not null AUTO_INCREMENT,
    name      varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT null,
    quantity  int,
    price     int,
    supplier  int,
    createdAt datetime,
    createdBy int,
    isDelete  boolean,
    deletedAt datetime,
    deletedBy int,
    updatedAt datetime,
    updatedBy int,
    primary key (id)
);

create table supplier
(
    id        int not null AUTO_INCREMENT,
    name      varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT null,
    createdAt datetime,
    createdBy int,
    isDelete  boolean,
    deletedAt datetime,
    deletedBy int,
    updatedAt datetime,
    updatedBy int,
    primary key (id)
);

alter table supplier
    add image varchar(255);

