CREATE table storage
(
    id           bigint not null AUTO_INCREMENT,
    serialNumber varchar(255),
    cardNumber   varchar(255),
    expiredAt    datetime,
    productId    int,
    createdAt    datetime,
    createdBy    int,
    updatedAt    datetime,
    updatedBy    int,
    deletedAt    datetime,
    deletedBy    int,
    primary key (id)
);

alter table storage
    add column isUsed boolean;
alter table storage
    add column isDelete boolean;




create table order_detail
(
    id      bigint AUTO_INCREMENT,
    `order` bigint,
    storage bigint,
    primary key (id)
);

create table `order`
(
    id          bigint AUTO_INCREMENT,
    user        int,
    status      nvarchar(255),
    totalAmount int,
    product     int,
    quantity    int,
    isDelete    boolean,
    createdAt   datetime,
    createdBy   int,
    updatedAt   datetime,
    updatedBy   int,
    deletedAt   datetime,
    deletedBy   int,
    primary key (id)
);


CREATE TABLE IF NOT EXISTS sellphonecard.`transactions`
(
    id        INT        NOT NULL AUTO_INCREMENT,
    user      INT        NULL DEFAULT NULL,
    orderId   bigint     NULL DEFAULT NULL,
    money     int        NULL DEFAULT NULL,
    note      TEXT       NULL DEFAULT NULL,
    type      TINYINT(1) NULL DEFAULT NULL,
    status    TINYINT(1) NULL DEFAULT NULL,
    updatedAt DATETIME   NULL DEFAULT NULL,
    updatedBy INT        NULL DEFAULT NULL,
    createdAt  DATETIME   NULL DEFAULT NULL,
    createdBy  INT        NULL DEFAULT NULL,
    PRIMARY KEY (id),
    INDEX user (user ASC) VISIBLE,
    INDEX orderId (orderId ASC) VISIBLE
);

update user set balance = 1000000 where id = 2;

create table notice (
    id bigint not null auto_increment,
    subject text collate utf8mb4_unicode_ci,
    content text collate utf8mb4_unicode_ci,
    seen tinyint(1),
    user int,
    isDelete tinyint(1),
    createdAt datetime,
    createdBy int,
    updatedAt datetime,
    updatedBy int,
    deletedAt datetime,
    deletedBy int,
    primary key (id)
);